(51, 'Technical Competencies', 'RESILIENCE - Ability to respond professionally in stressful and difficult situations; to adapt quickly to change and easily consider new approaches.', '2023-05-24 23:46:01', '2023-05-24 23:46:01'),
(52, 'Technical Competencies', 'RESPECTING AND CARING FOR PATIENTS - Ability to establish a relationship of trust with patient by treating him/her with respect to his/her religious, cultural, or social background; respecting the right of patient to confidentiality and privacy.', '2023-05-24 23:47:47', '2023-05-24 23:47:47'),
(53, 'Technical Competencies', 'RISK MANAGEMENT - Ability to plan, develop, and implement measures that will avoid, overcome or compensate for elements of risk.', '2023-05-24 23:49:59', '2023-05-24 23:49:59'),
(54, 'Technical Competencies', 'SAFETY AWARENESS - Ability to identify and correct conditions that affect employee safety, upholding safety standards.', '2023-05-24 23:51:10', '2023-05-24 23:51:10'),
(55, 'Technical Competencies', 'SCIENTIFIC KNOWLEDGE FOR HEALTH/MEDICAL STAFF - Ability to maintain basic level of biomedical/scientific knowledge and understanding of areas of research conducted and/or supported by the organization.', '2023-05-24 23:52:36', '2023-05-24 23:52:36'),
(56, 'Technical Competencies', 'SCIENTIFIC REVIEW MANAGEMENT - Ability to plan and conduct scientific review activities to ensure an unbiased, informed review process, and successful programmatic outcomes.', '2023-05-24 23:53:51', '2023-05-24 23:53:51'),
(57, 'Technical Competencies', 'STATISTICAL RESEARCH FOR HEALTH - Ability to accurately design data acquisition methods, assess data quality/realibility, analyze trends using statistical methodologies, monitor, and report health statistics and other data relevant to clients using necess', '2023-05-24 23:55:53', '2023-05-24 23:55:53'),
(58, 'Technical Competencies', 'TECHNICLA CONSULTING - Ability to provide expertise, technical guidance and training to ensure projects and operations are carried out effectively.', '2023-05-24 23:57:01', '2023-05-24 23:57:01'),
(59, 'Technical Competencies', 'TECHNICAL WRITING - Ability to write useful, relevant and accurate information on a particular occupational field where body of knowledge, complex ideas, concepts, processes or procedures need to be communicated. Geared to specifically target audience in ', '2023-05-24 23:59:39', '2023-05-24 23:59:39'),
(60, 'Technical Competencies', 'TIME MANAGEMENT - Ability to effectively manage one\'s time and resources to ensure that work is completed in efficient and timely manner.', '2023-05-25 00:01:19', '2023-05-25 00:01:19'),
(61, 'Technical Competencies', 'TRAINING PROGRAM ADMINISTRATION - Ability to promote individual and organizational development through planning, designing, and managing employee development and training programs/services.', '2023-05-25 00:02:52', '2023-05-25 00:02:52'),
(62, 'Technical Competencies', 'WORKFORCE PLANNING - Ability to understand and demonstrate knowledge of business strategy and human resource (HR) concepts, principles, and practices to effectively align the needs of LGU and its workforce and to design strategies that support leadership ', '2023-05-25 00:05:59', '2023-05-25 00:05:59');

